import React from 'react';
import styled from "styled-components";

const StyledBox=styled.div`
border: 1px solid yellow;
width: 30vh;
height: 30vh;
font-size : 20px;
`;

const text=["멋쟁이사자처럼", "중앙대학교", "최고"];

const Boxb = () => {
    return text.map((t)=><StyledBox>{t}</StyledBox>
    ); 

};

export default Boxb
